import React, {useCallback, useEffect, useState} from 'react';
import Container from "../../Components/Container/Container";
import {useHttp} from "../../Hooks/http.hook";
import RopesTable from "../../Components/RopesTable/RopesTable";

const RopesInStockPage = () => {
    const {loading, error, request} = useHttp();
    const [ropes, setRopes] = useState(null);

    const fetchRopes = useCallback(async () => {
      try {
          const fetched = await request('/ropes/getAllRopes', 'GET');
          setRopes(fetched);
      }  catch (e) {
          console.log(e);
      }
    }, [request])

    // useEffect(() => {
    //     fetchRopes();
    // }, [fetchRopes])


    return (
        <Container>
            <div>
                Ropes in stock page
                <RopesTable />
            </div>
        </Container>
    );
};

export default RopesInStockPage;
